043d \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D1%80%D0%B0%D0%B4%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8\" class=\"mw-redirect\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0440\u0430\u0434\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0439 \u041d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438\">\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0420\u0430\u0434\u044b<\/a>.<\/li><li>\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438\">\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043c\u0435\u0436\u0434\u0443 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438 \u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BB%D0%B0%D1%8F_%D0%91%D0%B0%D1%88%D0%BA%D0%B8%D1%80%D0%B8%D1%8F\" title=\"\u041c\u0430\u043b\u0430\u044f \u0411\u0430\u0448\u043a\u0438\u0440\u0438\u044f\">\u041c\u0430\u043b\u043e\u0439 \u0411\u0430\u0448\u043a\u0438\u0440\u0438\u0438<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u043e \u00ab\u0421\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438 \u0441 \u0411\u0430\u0448\u043a\u0438\u0440\u0441\u043a\u0438\u043c \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u043e \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0410\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u043e\u0439 \u0411\u0430\u0448\u043a\u0438\u0440\u0438\u0438\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B7%D0%B0%D1%81-%D0%A1%D0%B8%D1%82%D0%B8_(%D0%9C%D0%B8%D1%81%D1%81%D1%83%D1%80%D0%B8)\" title=\"\u041a\u0430\u043d\u0437\u0430\u0441-\u0421\u0438\u0442\u0438 (\u041c\u0438\u0441\u0441\u0443\u0440\u0438)\">\u041a\u0430\u043d\u0437\u0430\u0441-\u0441\u0438\u0442\u0438<\/a> \u0432\u044b\u043f\u0443\u0449\u0435\u043d \u0432 \u043f\u0440\u043e\u043a\u0430\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u044b\u0439 \u043f\u0440\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%81%D0%BD%D0%B5%D0%B9,_%D0%A3%D0%BE%D0%BB%D1%82\" title=\"\u0414\u0438\u0441\u043d\u0435\u0439, \u0423\u043e\u043b\u0442\">\u0423\u043e\u043b\u0442\u0430 \u0414\u0438\u0441\u043d\u0435\u044f<\/a>.<\/li><li>\u041f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442 \u0432 \u0412\u0435\u0440\u0445\u043d\u0435\u0439 \u0421\u0438\u043b\u0435