 Heaven.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a><ul><li>\u0423\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u043e \u0437\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BE%D0%B9_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" title=\"\u0413\u0435\u0440\u043e\u0439 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438\">\u0413\u0435\u0440\u043e\u044f \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438<\/a>.<\/li><li>20-21 \u043c\u0430\u0440\u0442\u0430 \u0432 \u041a\u0438\u0435\u0432\u0435 \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432\u0441\u0442\u0440\u0435\u0447\u0430 \u043b\u0438\u0434\u0435\u0440\u043e\u0432 \u0421\u041d\u0413.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u0441\u0438\u043d\u043a\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u044d\u043a\u0441\u0442\u0440\u0435\u043c\u0438\u0441\u0442\u0441\u043a\u0430\u044f \u0441\u0435\u043a\u0442\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%83%D0%BC_%D0%A1%D0%B8%D0%BD%D1%80%D0%B8%D0%BA%D1%91\" title=\"\u0410\u0443\u043c \u0421\u0438\u043d\u0440\u0438\u043a\u0451\">\u0410\u0443\u043c \u0421\u0438\u043d\u0440\u0438\u043a\u0451<\/a>\u00bb \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D1%80%D0%B8%D0%BD%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B0%D1%82%D0%B0%D0%BA%D0%B0_%D0%B2_%D1%82%D0%BE%D0%BA%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%BC_%D0%BC%D0%B5%D1%82%D1%80%D0%BE\" class=\"mw-redirect\" title=\"\u0417\u0430\u0440\u0438\u043d\u043e\u0432\u0430\u044f \u0430\u0442